import { Fragment } from 'react';

import mealimage from '../assets/meal.jpg';
import classes from './Header.module.css';


const Header = props =>{
   return (
   <Fragment>
    <header>
        <h1>ReactMeals</h1>
        <button>Cart</button>
    </header>
    <div classesName={classes['main-image']}>
        <img src={mealimage} alt='Food' />
    </div>
   </Fragment>

   ); 
};

export default Header;
